import React from 'react';
import './App.css';
import Lottie from 'lottie-react';  // Import the Lottie component from lottie-react
import animationData from '../public/Animation.json';  // Import your animation JSON file

function App() {
  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <h2>Finance Portal</h2>
      </nav>

      {/* Main content */}
      <div className="main-content">
        <h1>
          All things finance,<br /> right here.
        </h1>

        {/* Lottie Animation */}
        <div className="lottie-container">
          <Lottie
            animationData={animationData}  // Pass the JSON animation data
            style={{ height: '300px', width: '500px' }}
          />
        </div>

        {/* Get Started Button */}
        <button className="get-started-button">Get Started</button>
      </div>
    </div>
  );
}

export default App;
